import React, { useState } from "react";
import axios from "axios";

const indianStates = [
    "Andhra Pradesh", "Arunachal Pradesh", "Assam", "Bihar", "Chhattisgarh",
    "Delhi", "Goa", "Gujarat", "Haryana", "Himachal Pradesh", "Jharkhand",
    "Karnataka", "Kerala", "Madhya Pradesh", "Maharashtra", "Manipur",
    "Meghalaya", "Mizoram", "Nagaland", "Odisha", "Puducherry", "Punjab",
    "Rajasthan", "Tamil Nadu", "Telangana", "Tripura",
    "Uttar Pradesh", "Uttarakhand", "West Bengal"
];

const coursesList = [
    "Computer Science and Engineering (4 Years, Bachelor of Technology)",
    "Electrical Engineering (4 Years, Bachelor of Technology)",
    "Civil Engineering (4 Years, Bachelor of Technology)",
    "Mechanical Engineering (4 Years, Bachelor of Technology)",
    "Electronics and Communication Engineering (4 Years, Bachelor of Technology)",
    "Chemical Engineering (4 Years, Bachelor of Technology)",
    "Engineering Physics (4 Years, Bachelor of Technology)",
    "Mathematics and Computing (4 Years, Bachelor of Technology)",
    "Interdisciplinary Sciences (5 Years, Bachelor of Science and Master of Science (Dual Degree))",
    // Add more courses as needed
];

const RankForm = () => {
    const [examType, setExamType] = useState(""); // JEE Mains or JEE Advanced
    const [state, setState] = useState("");
    const [gender, setGender] = useState("");
    const [category, setCategory] = useState("");
    const [rank, setRank] = useState("");
    const [selectedCourses, setSelectedCourses] = useState([]); // State for selected courses
    const [colleges, setColleges] = useState([]);

    const fetchColleges = async (e) => {
        e.preventDefault();

        if (!examType || !state || !gender || !category || !rank || selectedCourses.length === 0) {
            alert("Please select all fields.");
            return;
        }

        try {
            const response = await axios.get(
                `http://localhost:5000/api/colleges/search?examType=${examType}&state=${state}&gender=${gender}&category=${category}&rank=${rank}&courses=${selectedCourses.join(",")}`
            );
            setColleges(response.data);
        } catch (error) {
            console.error("Error fetching data:", error);
        }
    };

    const handleCourseChange = (e) => {
        const value = Array.from(e.target.selectedOptions, option => option.value);
        if (value.length <= 3) {
            setSelectedCourses(value);
        } else {
            alert("You can select a maximum of 3 courses.");
        }
    };

    return (
        <div>
            <h2>Find Your College</h2>
            <form onSubmit={fetchColleges}>
                {/* Exam Type Selection */}
                <label>Exam Type:</label>
                <select value={examType} onChange={(e) => setExamType(e.target.value)}>
                    <option value="">Select Exam</option>
                    <option value="jeeMains">JEE Mains</option>
                    <option value="jeeAdvanced">JEE Advanced</option>
                </select>

                {/* State Selection */}
                <label>State:</label>
                <select value={state} onChange={(e) => setState(e.target.value)}>
                    <option value="">Select State</option>
                    {indianStates.map((s) => (
                        <option key={s} value={s}>{s}</option>
                    ))}
                </select>

                {/* Gender Selection */}
                <label>Gender:</label>
                <select value={gender} onChange={(e) => setGender(e.target.value)}>
                    <option value="">Select Gender</option>
                    <option value="genderNeutral">Gender-Neutral</option>
                    <option value="female">Female</option>
                </select>

                {/* Category Selection */}
                <label>Category:</label>
                <select value={category} onChange={(e) => setCategory(e.target.value)}>
                    <option value="">Select Category</option>
                    <option value="OPEN">OPEN</option>
                    <option value="EWS">EWS</option>
                    <option value="OBC_NCL">OBC-NCL</option>
                    <option value="SC">SC</option>
                    <option value="ST">ST</option>
                </select>

                {/* Course Selection */}
                <label>Select Courses (up to 3):</label>
                <select multiple value={selectedCourses} onChange={handleCourseChange}>
                    {coursesList.map((course) => (
                        <option key={course} value={course}>
                            {course}
                        </option>
                    ))}
                </select>

                {/* Rank Input */}
                <label>Enter Your Rank:</label>
                <input
                    type="number"
                    value={rank}
                    onChange={(e) => setRank(e.target.value)}
                    placeholder="Enter your rank"
                    required
                />

                <button type="submit">Search Colleges</button>
            </form>

            {/* Display Results */}
            {colleges.length > 0 && (
                <div>
                    <h3>Available Colleges:</h3>
                    <ul>
                        {colleges.map((college, index) => (
                            <li key={index}>
                                <strong>{college.name}</strong>
                                <ul>
                                    <li>
                                        {college.courseName}: 
                                        Opening Rank: {college.rankData.openingRank}, 
                                        Closing Rank: {college.rankData.closingRank}
                                    </li>
                                </ul>
                            </li>
                        ))}
                    </ul>
                </div>
            )}
        </div>
    );
};

export default RankForm;
